import React from 'react';
import './Header.css';
import Slider from './Slider';
import Navigation from './Navigation';



const Header = () => {
    return (<>

<Navigation {...props}></Navigation>
<Slider {...props}> </Slider>
   
    </>
    );
}
 
export default Header;
